package projectp1;

public class AtoZ {

	public static void main(String[] args) {
		// TODO Auto-generated method stub
		for(char ch='A';ch<='Z';ch++) {
			System.out.print(ch+" ");
		}
		System.out.println();
		
		for(char i=65;i<=90;i++) {
			System.out.print(i+" ");
		}

	}

}
